gq.cookdata = function()
{
	if(typeof(gq.strings) == 'undefined' || !gq.strings) debugger;
	if(!gq.data.quran['quran-corpus']) gq.data.quran['quran-corpus'] = {};
	if(!gq.data.quran['quran-corpus'][1]) console.log("gq.data.quran['quran-corpus'][1] nonexistant... creating whole bunch");
	if(!gq.loadedEMPTYQURANJSON){ gq.data = $.extend(true, gq.data, EMPTYQURANJSON); gq.loadedEMPTYQURANJSON = true; console.log(' gq.loadedEMPTYQURANJSON = true'); }//loadup the empty base structure

	if(!gq.loadedPart1 && typeof(gq.MANZIL1) != 'undefined' && gq.MANZIL1.length > 0){
		for(var i=1, position = parseInt( gq.MANZIL1[0] ); i <= gq.MANZIL1.length; ++i, ++position){
			if(!gq.data.quran['quran-corpus'][ position ]) { gq.data.quran['quran-corpus'][position] = {}; }
			gq.data.quran['quran-corpus'][ position ].verse = gq.MANZIL1[ i ];
		}
	}
	if(!gq.loadedPart1 && typeof(gq.MANZIL7) != 'undefined' && gq.MANZIL7.length > 0){
		for(var i=1, position = parseInt( gq.MANZIL7[0] ); i <= gq.MANZIL7.length; ++i, ++position){
			if(!gq.data.quran['quran-corpus'][ position ]) { gq.data.quran['quran-corpus'][position] = {}; }
			gq.data.quran['quran-corpus'][ position ].verse = gq.MANZIL7[ i ];
		}
		gq.loadedPart1 = true; 
		layout.message('', '1: '+(gq.loadedPercent+33)+ '% loaded');  $.growlUI('', 'Quran data loaded ' + (gq.loadedPercent+33)+ '%');
		console.log('quran: loadedPart1. loadedPercent: ' + (gq.loadedPercent + 33 + '%') ); //part1 includes MANZIL1 and 7
	} 
	//for(var i=1; i <= gq.strings.length; ++i){
	//	if(!gq.data.quran['quran-corpus'][i]) { gq.data.quran['quran-corpus'][i] = {}; }
	//	gq.data.quran['quran-corpus'][i].verse = gq.strings[i];
	//}
	if(!gq.loadedPart2 && typeof(gq.MANZIL56) != 'undefined' && gq.MANZIL56.length > 0){
		for(var i=1, position = parseInt( gq.MANZIL56[0] ); i <= gq.MANZIL56.length; ++i, ++position){
			if(!gq.data.quran['quran-corpus'][ position ]) { gq.data.quran['quran-corpus'][position] = {}; }
			gq.data.quran['quran-corpus'][ position ].verse = gq.MANZIL56[ i ];
		}
		gq.loadedPart2 = true; 
		layout.message('', '2: '+ (gq.loadedPercent+33)+ '% loaded');  $.growlUI('', 'Quran data loaded ' + (gq.loadedPercent+33)+ '%');
		console.log('quran: loadedPart2. loadedPercent: ' + (gq.loadedPercent + 33 + '%') ); //part2 includes MANZIL5, 6
		if(gq.surah() >= 26 && gq.surah() <= 49 ) gq.custom.unblockui(); //repaint the page, if the current surah is in this manzil
	} 

	if(!gq.loadedPart3 && typeof(gq.MANZIL234) != 'undefined' && gq.MANZIL234.length > 0){
		for(var i=1, position = parseInt( gq.MANZIL234[0] ); i <= gq.MANZIL234.length; ++i, ++position){
			if(!gq.data.quran['quran-corpus'][ position ]) { gq.data.quran['quran-corpus'][position] = {}; }
			gq.data.quran['quran-corpus'][ position ].verse = gq.MANZIL234[ i ];
		}
		gq.loadedPart3 = true; 
		layout.message('', '3: '+ (gq.loadedPercent+34)+ '% loaded'); $.growlUI('', 'Quran data loaded ' + (gq.loadedPercent+34)+ '%');
		console.log('quran: loadedPart3. loadedPercent: ' + (gq.loadedPercent + 34 + '%') );  //part3 includes MANZIL2, 3, 4
		if(gq.surah() >= 5 && gq.surah() <= 25 ) gq.custom.unblockui(); //repaint the page if within this manzil
		//cook up the strings too... gq.strings (this needed for the count statistics only)
		gq.stringsGenerate();		
	} 

	gq.loadedPercent = 0; if(gq.loadedPart1) gq.loadedPercent += 33; if(gq.loadedPart2) gq.loadedPercent += 33; if(gq.loadedPart3) gq.loadedPercent += 34; 
	console.log('Total data loadedPercent: ' + gq.loadedPercent + '%. '); // + 'data cooked with ' + gq.strings.length +' strings');
};

gq.custom = {};
gq.custom.timeoutID = null;
gq.custom.blockui = function(){
	if(gq.custom.timeoutID) clearTimeout(gq.custom.timeoutID);
	gq.custom.timeoutID = setTimeout('gq.custom.UI_blockui()', 1000);
}
gq.custom.unblockui = function(){
	if(gq.custom.timeoutID) clearTimeout(gq.custom.timeoutID);
	gq.custom.UI_unblockui(); //gq.custom.timeoutID = setTimeout('gq.custom.UI_blockui()', 1000);
	$('body').trigger('prevPage'); 
	setTimeout( "$('body').trigger('nextPage');", 150); //have to repaint page. doing crappy way, since layout.ayahChanged() no worky, and no resetView method
}

gq.custom.UI_blockui = function(){
	$('.ayahs').block({ 
		message: '<h4>Please wait</h4>', 
		css: { border: '3px solid #a00' } 
	});
}

gq.custom.UI_unblockui = function(){
	$('.ayahs').unblock({ 	});
}
	
gq.stringsGenerate = function(){
	gq.strings = ["-1"];
	var parts = [gq.MANZIL1, gq.MANZIL234, gq.MANZIL56, gq.MANZIL7];
	$.each(parts, function(a, item){
		if(item){
			var index = item[0]; //will be 1, 670, 2933 or 4631
			var currIndex = gq.strings.length;
			if(index == currIndex){
				gq.strings = gq.strings.concat(item.slice(1) );
				console.log( 'concatanated ' + a +'\t'+ item.length +'\t'+ gq.strings.length);
			}
			else{
				console.log('failed concat ' + index +'\t'+ currIndex +'\t'+ gq.strings.length );  //debugger; //TODO: even if some parts missing, let those array values be null... fill in the rest.
			}
		}
		else console.log( a +'\t'+ 'empty' +'\t'+ gq.strings.length);
	});
}
		
gq.load = function (surah, ayah)
{
	//$("#audioPlayer").data("jplayer") = {};
	firstLoad = false;
	notCachedQuranID = true;

	if (surah && ayah)
		this.search._keyword = false;
	
	if (!surah && !ayah && !this.search.isActive())
	{
		firstLoad = true;
		this._cookieRead();
		this.url.load();
	}
	
	if (this.search.isActive())
	{
		this.search.loading(true);
		var requestUrl = this.apiURL;
		
		if (firstLoad)
			requestUrl += 'all/';
		
		requestUrl += 'search/'+this.search.keyword()+'/'+this.search.position();
		
		if (this.search.position() == 0)
			this.url.save();
	}
	else if (!surah && !ayah)
	{	
		this.settings.page = 0; // url wont load, if its same as url page 1=1
		this.url.load();
		
		this.settings.surah = this.settings.surah || 1;
		this.settings.ayah = this.settings.ayah || 1;
		this.settings.juz =  Quran.ayah.juz(this.settings.surah, this.settings.ayah);	
		this.settings.page = Quran.ayah.page(this.settings.surah, this.settings.ayah);		
		this.data.ayahList = Quran.ayah.listFromPage(this.settings.page);

		requestUrl = this.apiURL+'all/page/'+this.settings.page;

		if (this.quran.length() > 0)// TODO add this.noData for getting no quran text from server.
			requestUrl += '/'+this.quran.selectedString();
		/*if (this.settings.selectedLanguage) // TODO language selection here
			requestUrl += '/'+this.settings.selectedLanguage;*/
	}//TODO add other methods too ex: search and language pack
	else
	{
		this.settings.surah = surah;
		this.settings.ayah = ayah;
		this.settings.juz = Quran.ayah.juz(surah, ayah);
		this.settings.page = Quran.ayah.page(surah, ayah);		
		this.data.ayahList = Quran.ayah.listFromPage(this.settings.page);
					
		notCachedQuranID = this.quran.textNotCached();			
		
		requestUrl = this.apiURL+'page/'+this.settings.page+'/'+notCachedQuranID;
		this.url.save();
	}
	
	this.save();
	this._gaqPush(['_trackPageview', '/#!'+this.url.page()]);
	
	if (this.noData && !firstLoad) // if no data need to be output, then run request only once
		notCachedQuranID = false;

	if (notCachedQuranID)
	{
		if (firstLoad) {
			var LOADLOCAL = false; //use it as fallback
			if(location.href.indexOf('file://') != -1) LOADLOCAL = true;
			if( LOADLOCAL ) {
				if(console && console.log) console.log('loaded quranlist JSON local data, as AJAX call failed'); //debugger;
				gq._loadResponse(QURANLISTJSON, firstLoad);
			}
			else $.getJSON('quran-all.json', function(response) {      
			  gq._loadResponse(response, firstLoad);
			}, function(error){ //this call never enters, even if page run locally and ajax call cannot load. known issue.
				gq._loadResponse(QURANLISTJSON, firstLoad);
				if(console && console.log) console.log('loaded quranlist JSON local data, as AJAX call failed'); //debugger;
			});
			//$.getJSON('quran-corpus.json', function(response) {      
			// gq._loadResponse(response, firstLoad);
			//});
		}
		else 
		{
			$jsonp = $.support.cors ? '' : '.jsonp?callback=?';
			$.ajaxSetup({ cache: true, jsonpCallback: 'quranData' });
			$.getJSON(requestUrl+$jsonp, function(response) {      
			  gq._loadResponse(response, firstLoad);
			});
		}
			
			
		//$jsonp = $.support.cors ? '' : '.jsonp?callback=?';
		//$.ajaxSetup({ cache: true, jsonpCallback: 'quranData' });

		///$.getJSON('quran-all.json', function(response) {			
		///	gq._loadResponse(response, firstLoad);
		///});
		//$.getJSON('quran-corpus.json', function(response) {			
		//	gq._loadResponse(response, firstLoad);
		//});
		//gq.cookdata();
	}
	else
	{
		gq.layout.display(true);	
		gq.player.load('play');
	}
	
	return false;
};


